import Helloworld from "./Helloworld";



function App() {
  const profile_image = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSJOrOSakEFECa1Wza9061ZAHl6aibu6z40rwGCJ4md6g&s"
  return (

    <div style={{
      backgroundColor: 'grey',
    }}>
      <p style={{
        textAlign: "center",
        color: 'black',


      }}>
        <img src={profile_image}></img>
        <Helloworld name="Mac" city="Valenzuela City"></Helloworld>
        <div>
          <ul style={{
            listStyle: "none",
            backgroundColor: 'beige',
            paddingLeft: '5px',
            paddingRight: '5px',

          }}>
            <li>PRC Licensed Holder</li>
            <li>Member of PNA</li>
            <li>Member of ANSAP</li>
            <li>Philippine National Red Cross Volunteer</li>
            <li>Basic Life Support - Advance Life Support Certified</li>
          </ul>
        </div>
      </p>
    </div>
  );
}

export default App;
